import React from "react";
import './Stil.css';
import Img from './slika.jpg';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
class Home extends React.Component {
  render() {
    return (
      <div className="main-div">
         <img src= {Img} id="picture" alt="pic" />
        <div className="table-responsive" id="tabelica-div">
          
         
            <table className="table table-hover" id="tabelica">
              <thead>
                <tr>
                  <th scope="col">Šejla Pljakić</th>
                </tr>
              </thead>
            </table>
            <br />
          </div>
          <br />
          <p id="info"> 
            <h3>Bachelor of Electrical Engineering </h3>
           <h3>  Software engineer </h3>

           <Card style={{ width: '18rem' }}>
              <Card.Img variant="top" src="holder.js/100px180" />
              <Card.Body>
                <Card.Title>About me</Card.Title>
                <Card.Text>
                Inspiring, a mission-driven enthusiast  who can help you to create or adapt customized applications with reusable and maintainable components for clients or other organizations. 
 A proactive contributor who listens to clients needs and works with engineering and programming skills to analyze, define, design and implement complex, distributed software systems to meet those needs.         
 A passionate innovator and problem solver who helps others to be unique and to use their full potential and to get customer trust.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
 
          </p>
          <br />
      </div>
    );
  }
}

export default Home;
